    "# Cancer Dataset PCA Analysis for Anderson Cancer Center\n",
    "# Data Analyst: Principal Component Analysis for Donor Funding Model\n",
    "\n",
    "import numpy as np\n",
    "import pandas as pd\n",
    "import matplotlib.pyplot as plt\n",
    "import seaborn as sns\n",
    "from sklearn.datasets import load_breast_cancer\n",
    "from sklearn.preprocessing import StandardScaler\n",
    "from sklearn.decomposition import PCA\n",
    "from sklearn.model_selection import train_test_split\n",
    "from sklearn.linear_model import LogisticRegression\n",
    "from sklearn.metrics import classification_report, confusion_matrix, accuracy_score, roc_auc_score, roc_curve\n",
    "import warnings\n",
    "warnings.filterwarnings('ignore')\n",
    "\n",
    "class CancerDataAnalyzer:\n",
    "    \"\"\"\n",
    "    Cancer Data Analyzer for PCA and Logistic Regression Analysis\n",
    "    Designed for Anderson Cancer Center donor funding model development\n",
    "    \"\"\"\n",
    "    \n",
    "    def __init__(self):\n",
    "        self.data = None\n",
    "        self.X = None\n",
    "        self.y = None\n",
    "        self.X_scaled = None\n",
    "        self.pca = None\n",
    "        self.X_pca = None\n",
    "        self.feature_names = None\n",
    "        self.target_names = None\n",
    "        \n",
    "    def load_and_explore_data(self):\n",
    "        \"\"\"Load and explore the breast cancer dataset\"\"\"\n",
    "        print(\"=\"*60)\n",
    "        print(\"ANDERSON CANCER CENTER - DATA ANALYSIS REPORT\")\n",
    "        print(\"=\"*60)\n",
    "        print(\"Loading breast cancer dataset from sklearn...\")\n",
    "        \n",
    "        # Load the dataset\n",
    "        self.data = load_breast_cancer()\n",
    "        self.X = self.data.data\n",
    "        self.y = self.data.target\n",
    "        self.feature_names = self.data.feature_names\n",
    "        self.target_names = self.data.target_names\n",
    "        \n",
    "        # Create DataFrame for easier manipulation\n",
    "        df = pd.DataFrame(self.X, columns=self.feature_names)\n",
    "        df['target'] = self.y\n",
    "        \n",
    "        print(f\"\\nDataset Overview:\")\n",
    "        print(f\"- Number of samples: {self.X.shape[0]}\")\n",
    "        print(f\"- Number of features: {self.X.shape[1]}\")\n",
    "        print(f\"- Target classes: {self.target_names}\")\n",
    "        print(f\"- Class distribution:\")\n",
    "        print(f\"  * Malignant (0): {np.sum(self.y == 0)} cases\")\n",
    "        print(f\"  * Benign (1): {np.sum(self.y == 1)} cases\")\n",
    "        \n",
    "        # Display basic statistics\n",
    "        print(f\"\\nFeature Statistics Summary:\")\n",
    "        print(df.describe().round(2))\n",
    "        \n",
    "        return df\n",
    "    \n",
    "    def preprocess_data(self):\n",
    "        \"\"\"Standardize the features for PCA\"\"\"\n",
    "        print(f\"\\n\" + \"=\"*50)\n",
    "        print(\"DATA PREPROCESSING\")\n",
    "        print(\"=\"*50)\n",
    "        print(\"Standardizing features for PCA analysis...\")\n",
    "        \n",
    "        scaler = StandardScaler()\n",
    "        self.X_scaled = scaler.fit_transform(self.X)\n",
    "        \n",
    "        print(\"âœ“ Features successfully standardized\")\n",
    "        print(f\"Scaled data shape: {self.X_scaled.shape}\")\n",
    "        \n",
    "    def perform_pca_analysis(self, n_components=2):\n",
    "        \"\"\"Perform PCA analysis and reduce to specified components\"\"\"\n",
    "        print(f\"\\n\" + \"=\"*50)\n",
    "        print(\"PRINCIPAL COMPONENT ANALYSIS\")\n",
    "        print(\"=\"*50)\n",
    "        \n",
    "        # Fit PCA with all components first to analyze variance\n",
    "        pca_full = PCA()\n",
    "        pca_full.fit(self.X_scaled)\n",
    "        \n",
    "        # Calculate cumulative variance\n",
    "        cumulative_variance = np.cumsum(pca_full.explained_variance_ratio_)\n",
    "        \n",
    "        print(f\"Variance Analysis:\")\n",
    "        print(f\"- First 2 components explain: {cumulative_variance[1]:.1%} of total variance\")\n",
    "        print(f\"- First 5 components explain: {cumulative_variance[4]:.1%} of total variance\")\n",
    "        print(f\"- First 10 components explain: {cumulative_variance[9]:.1%} of total variance\")\n",
    "        \n",
    "        # Perform PCA with specified components\n",
    "        self.pca = PCA(n_components=n_components)\n",
    "        self.X_pca = self.pca.fit_transform(self.X_scaled)\n",
    "        \n",
    "        print(f\"\\nPCA Results:\")\n",
    "        print(f\"- Reduced from {self.X.shape[1]} to {n_components} dimensions\")\n",
    "        print(f\"- Explained variance ratio: {self.pca.explained_variance_ratio_}\")\n",
    "        print(f\"- Total variance explained: {sum(self.pca.explained_variance_ratio_):.1%}\")\n",
    "        \n",
    "        return self.X_pca\n",
    "    \n",
    "    def analyze_component_loadings(self):\n",
    "        \"\"\"Analyze which original features contribute most to each principal component\"\"\"\n",
    "        print(f\"\\n\" + \"=\"*50)\n",
    "        print(\"COMPONENT LOADING ANALYSIS\")\n",
    "        print(\"=\"*50)\n",
    "        \n",
    "        # Get the loadings (components)\n",
    "        loadings = self.pca.components_\n",
    "        \n",
    "        # Create DataFrame for better visualization\n",
    "        loadings_df = pd.DataFrame(\n",
    "            loadings.T,\n",
    "            columns=[f'PC{i+1}' for i in range(loadings.shape[0])],\n",
    "            index=self.feature_names\n",
    "        )\n",
    "        \n",
    "        print(\"Top 10 features contributing to each Principal Component:\")\n",
    "        print(\"\\nPRINCIPAL COMPONENT 1:\")\n",
    "        pc1_top = loadings_df['PC1'].abs().sort_values(ascending=False).head(10)\n",
    "        for feature, loading in pc1_top.items():\n",
    "            direction = \"+\" if loadings_df.loc[feature, 'PC1'] > 0 else \"-\"\n",
    "            print(f\"  {direction} {feature}: {abs(loading):.3f}\")\n",
    "        \n",
    "        print(\"\\nPRINCIPAL COMPONENT 2:\")\n",
    "        pc2_top = loadings_df['PC2'].abs().sort_values(ascending=False).head(10)\n",
    "        for feature, loading in pc2_top.items():\n",
    "            direction = \"+\" if loadings_df.loc[feature, 'PC2'] > 0 else \"-\"\n",
    "            print(f\"  {direction} {feature}: {abs(loading):.3f}\")\n",
    "        \n",
    "        return loadings_df\n",
    "    \n",
    "    def visualize_pca_results(self):\n",
    "        \"\"\"Create comprehensive visualizations of PCA results\"\"\"\n",
    "        print(f\"\\n\" + \"=\"*50)\n",
    "        print(\"GENERATING VISUALIZATIONS\")\n",
    "        print(\"=\"*50)\n",
    "        \n",
    "        fig, axes = plt.subplots(2, 2, figsize=(15, 12))\n",
    "        fig.suptitle('Anderson Cancer Center - PCA Analysis Results', fontsize=16, fontweight='bold')\n",
    "        \n",
    "        # 1. PCA Scatter Plot\n",
    "        scatter = axes[0, 0].scatter(self.X_pca[:, 0], self.X_pca[:, 1], \n",
    "                                   c=self.y, cmap='RdYlBu', alpha=0.7, s=50)\n",
    "        axes[0, 0].set_xlabel(f'PC1 ({self.pca.explained_variance_ratio_[0]:.1%} variance)')\n",
    "        axes[0, 0].set_ylabel(f'PC2 ({self.pca.explained_variance_ratio_[1]:.1%} variance)')\n",
    "        axes[0, 0].set_title('PCA: Cancer Dataset (2 Components)')\n",
    "        axes[0, 0].grid(True, alpha=0.3)\n",
    "        plt.colorbar(scatter, ax=axes[0, 0], label='Benign (1) / Malignant (0)')\n",
    "        \n",
    "        # 2. Explained Variance\n",
    "        pca_full = PCA()\n",
    "        pca_full.fit(self.X_scaled)\n",
    "        axes[0, 1].plot(range(1, 11), np.cumsum(pca_full.explained_variance_ratio_[:10]), \n",
    "                       'bo-', linewidth=2, markersize=8)\n",
    "        axes[0, 1].axhline(y=0.8, color='r', linestyle='--', alpha=0.7, label='80% Variance')\n",
    "        axes[0, 1].axvline(x=2, color='g', linestyle='--', alpha=0.7, label='2 Components')\n",
    "        axes[0, 1].set_xlabel('Number of Components')\n",
    "        axes[0, 1].set_ylabel('Cumulative Explained Variance')\n",
    "        axes[0, 1].set_title('Cumulative Explained Variance')\n",
    "        axes[0, 1].grid(True, alpha=0.3)\n",
    "        axes[0, 1].legend()\n",
    "        \n",
    "        # 3. Feature Importance Heatmap\n",
    "        loadings = self.pca.components_\n",
    "        top_features_pc1 = np.argsort(np.abs(loadings[0]))[-10:]\n",
    "        top_features_pc2 = np.argsort(np.abs(loadings[1]))[-10:]\n",
    "        all_top_features = np.unique(np.concatenate([top_features_pc1, top_features_pc2]))\n",
    "        \n",
    "        heatmap_data = loadings[:, all_top_features]\n",
    "        feature_names_short = [name.replace('mean ', '').replace('worst ', 'w_')[:15] \n",
    "                              for name in self.feature_names[all_top_features]]\n",
    "        \n",
    "        sns.heatmap(heatmap_data, annot=True, fmt='.2f', cmap='RdBu_r', center=0,\n",
    "                   xticklabels=feature_names_short, yticklabels=['PC1', 'PC2'],\n",
    "                   ax=axes[1, 0], cbar_kws={'label': 'Loading Value'})\n",
    "        axes[1, 0].set_title('Top Feature Loadings for PC1 & PC2')\n",
    "        axes[1, 0].tick_params(axis='x', rotation=45)\n",
    "        \n",
    "        # 4. Class Separation in PCA Space\n",
    "        malignant_mask = self.y == 0\n",
    "        benign_mask = self.y == 1\n",
    "        \n",
    "        axes[1, 1].scatter(self.X_pca[malignant_mask, 0], self.X_pca[malignant_mask, 1], \n",
    "                          c='red', alpha=0.6, s=50, label='Malignant', edgecolors='darkred')\n",
    "        axes[1, 1].scatter(self.X_pca[benign_mask, 0], self.X_pca[benign_mask, 1], \n",
    "                          c='blue', alpha=0.6, s=50, label='Benign', edgecolors='darkblue')\n",
    "        axes[1, 1].set_xlabel(f'PC1 ({self.pca.explained_variance_ratio_[0]:.1%} variance)')\n",
    "        axes[1, 1].set_ylabel(f'PC2 ({self.pca.explained_variance_ratio_[1]:.1%} variance)')\n",
    "        axes[1, 1].set_title('Class Separation in PCA Space')\n",
    "        axes[1, 1].legend()\n",
    "        axes[1, 1].grid(True, alpha=0.3)\n",
    "        \n",
    "        plt.tight_layout()\n",
    "        plt.savefig('pca_analysis_results.png', dpi=300, bbox_inches='tight')\n",
    "        plt.show()\n",
    "        \n",
    "        print(\"âœ“ Visualizations generated and saved as 'pca_analysis_results.png'\")\n",
    "    \n",
    "    def implement_logistic_regression(self):\n",
    "        \"\"\"Implement logistic regression using PCA components (Bonus task)\"\"\"\n",
    "        print(f\"\\n\" + \"=\"*50)\n",
    "        print(\"BONUS: LOGISTIC REGRESSION IMPLEMENTATION\")\n",
    "        print(\"=\"*50)\n",
    "        \n",
    "        # Split the data\n",
    "        X_train, X_test, y_train, y_test = train_test_split(\n",
    "            self.X_pca, self.y, test_size=0.2, random_state=42, stratify=self.y\n",
    "        )\n",
    "        \n",
    "        print(f\"Training set size: {X_train.shape[0]}\")\n",
    "        print(f\"Test set size: {X_test.shape[0]}\")\n",
    "        \n",
    "        # Train logistic regression\n",
    "        lr_model = LogisticRegression(random_state=42)\n",
    "        lr_model.fit(X_train, y_train)\n",
    "        \n",
    "        # Make predictions\n",
    "        y_pred = lr_model.predict(X_test)\n",
    "        y_pred_proba = lr_model.predict_proba(X_test)[:, 1]\n",
    "        \n",
    "        # Calculate metrics\n",
    "        accuracy = accuracy_score(y_test, y_pred)\n",
    "        auc_score = roc_auc_score(y_test, y_pred_proba)\n",
    "        \n",
    "        print(f\"\\nLogistic Regression Results:\")\n",
    "        print(f\"- Accuracy: {accuracy:.3f}\")\n",
